import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)


// 这里定义非菜单栏的路由
const commonRoutes = [

  // 登录页面
  {
    path: '/login',
    component: () => import('@/views/login/Login.vue')
  },

  //注册页面
  {
    path: '/register',
    component: () => import('@/views/login/Rigister')
  },

  // 统计页面
  {
    path: '/statistics',
    component: () => import('@/views/statistics/Statistics.vue')
  }

]
// 这里定义菜单栏的路由
export const menuRoutes = [
  // 首页
  {
    path: '/home',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '首页', menu: true, icon: 'el-icon-s-platform', role: ['管理员', '员工'] },
    children: [
      {
        // 等价于取父亲的path
        path: '',
        meta: { title: '首页', menu: true },
        component: () => import('@/views/home/Home.vue')
      }
    ]
  },
  //凭证管理
  {
    path: '/voucher',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '凭证管理', menu: true, icon: 'el-icon-postcard', role: ['管理员'] },
    children: [
      {
        // 等价于取父亲的path
        path: '/voucher/whichVoucher',
        component: () => import('@/views/voucher/Voucher'),
        meta: { title: '凭证管理' },
      },
      {
        path: '/voucher/VoucherWord',
        component: () => import('@/views/voucher/VoucherWord'),
        meta: { title: '凭证字' },
      },
      {
        path: '/voucher/Summary',
        component: () => import('@/views/voucher/Summary'),
        meta: { title: '常用摘要' },
      },

    ]
  },
  //工资管理
  {
    path: '/Salary',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '工资管理', menu: true, icon: 'el-icon-bank-card', role: ['管理员'] },
    children: [
      {
        path: '/Salary/salary',
        meta: { title: '工资表' },
        component: () => import('@/views/salary/Salary.vue'),
      },
      {
        path: '/Salary/salarycolumn',
        meta: { title: '工资项' },
        component: () => import('@/views/salary/SalaryColumn.vue')
      }
    ]
  },
  //报销管理
  {
    path: '/AdminReimbursement',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '报销管理', menu: true, icon: 'el-icon-bank-card', role: ['管理员'] },
    children: [
      {
        path: '',
        meta: { title: '报销管理', menu: true },
        component: () => import('@/views/reimbursement/AdminReimbursement.vue'),
      },
    ]
  },
  //固定资产管理
  {
    path: '/fixedasset',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '固定资产管理', menu: true, icon: 'el-icon-office-building', role: ['管理员'] },
    children: [
      {
        path: '/property/Property',
        meta: { title: '固定资产' },
        component: () => import('@/views/fixedasset/Fixedasset.vue'),
      },
      {
        path: '/property/depreciation',
        meta: { title: '折旧明细表' },
        component: () => import('@/views/fixedasset/Depreciation.vue'),
      }
    ]
  },
  //发票管理
  {
    path: '/Invoice',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '发票管理', menu: true, icon: 'el-icon-s-goods', role: ['管理员'] },
    children: [
      {
        path: '/Invoice/EnterInvoice',
        meta: { title: '进项发票' },
        component: () => import('@/views/Invoice/EnterInvoice.vue'),
      },
      {
        path: '/Invoice/OutInvoice',
        meta: { title: '销项发票' },
        component: () => import('@/views/Invoice/OutInvoice.vue'),
      },
      {
        path: '/Invoice/AddInvoice',
        meta: { title: '新增发票' },
        component: () => import('@/views/Invoice/AddInvoice.vue'),
      }
    ]
  },
  //期末结转
  {
    path: '/carryover',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '期末结转', menu: true, icon: 'el-icon-s-marketing', role: ['管理员'] },
    children: [
      {
        path: '',
        meta: { title: '期末结转' },
        component: () => import('@/views/carryover/CarryOver'),
      },
    ]
  },

  // 系统设置
  {
    path: '/system',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '系统设置', menu: true, icon: 'el-icon-s-tools', role: ['管理员'] },
    children: [
      {
        path: '',
        meta: { title: '系统设置' },
        component: () => import('@/views/system/System.vue'),
      }
    ]
  },

  //用户中心
  {
    path: '/personalSystem',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '个人设置', menu: true, icon: 'el-icon-s-tools', role: ['员工'] },
    children: [
      {
        path: '/personalSystem/personalCenter',
        meta: { title: '个人中心' },
        component: () => import('@/views/system/PersonalCenter.vue'),
      },
      {
        path: '/personalSystem/passwordChange',
        meta: { title: '修改密码' },
        component: () => import('@/views/system/PasswordChange.vue'),
      }
    ]
  },
  //用户报销
  {
    path: '/personalReimbursement',
    component: () => import('@/layout/Layout.vue'),
    meta: { title: '用户报销', menu: true, icon: 'el-icon-bank-card', role: ['员工'] },
    children: [
      {
        path: '/personalReimbursement/PersonalReimbursement',
        meta: { title: '查看报销' },
        component: () => import('@/views/reimbursement/PersonalReimbursement.vue'),
      },
      {
        path: '/personalSystem/AddPersonalReimbursement',
        meta: { title: '新增报销' },
        component: () => import('@/views/reimbursement/AddPersonalReimbursement.vue'),
      }
    ]
  },

]

const router = new VueRouter({
  routes: [
    ...commonRoutes,
    ...menuRoutes,
    {
      path: '/*',
      component: () => import('@/views/error/error.vue')
    }
  ]
})

export default router
